thickness = 0.025
color = color(0.2, 0.6, 0.4, 1.0)
textVector = {y = 90, z = 0}

function onLoad()
  --Make an X above the middle of the table
  self.setVectorLines({
    {
      points    = { {-0.5, -0.5, 0.5}, {0.5, -0.5, 0.5}, {0.5, -0.5, -0.5},  {-0.5, -0.5, -0.5},  {-0.5, -0.5, 0.5},},
      color     = color,
      thickness = thickness,
      rotation  = {0,0,0},
    },
  })

  textPosition = self.getPosition()
  textPosition.y = textPosition.y - self.getScale().y / 2
  local text = spawnObject({
    type = "3DText",
    rotation = {90, textVector.y, textVector.z},
    position = textPosition,
  })
  text.TextTool.setValue("hello!")
  text.TextTool.setFontSize(40)
  text.TextTool.setFontColor(color)
end
